import React from 'react';
import './styles.css'; // Asegúrate de tener estilos básicos en este archivo

const Home = ({ onNavigate }) => {
  return (
    <div className="home-container">
      <h1>Carga de Archivos</h1>
      <button onClick={() => onNavigate('cargarReloj')}>Carga Reloj</button>
      <button onClick={() => onNavigate('cargarHorario')}>Carga Horario</button>
    </div>
  );
};

export default Home;
